import {Navigate} from "react-router-dom";
import React from "react";

export const withAuthRedirect = (Component) => {
    const RedirectComponent = () => {
        if(!this.props.isAuth) return <Navigate to={"/login"}/>
        return <Component {...this.props}/>
    }
}
